import React from 'react';
import Game from './Game';
import Join from './Join';
import { BrowserRouter as Router, Route } from 'react-router-dom';

import '../App.css';

const App = () => (
  <Router>
    <Route path='/' exact component={Join} />
    <Route path="/game" exact component={Game} />
  </Router>
);

export default App;
